import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Bell, Settings, LogOut, User, Shield, Users, Activity, FileText, X } from 'lucide-react';

const AdminSidebar = ({ isOpen, onClose }) => {
  const navigate = useNavigate();
  const [showNotifications, setShowNotifications] = useState(false);
  const [notifications, setNotifications] = useState([
    { id: 1, message: "New form submission - Visitor's Form", time: "5 min ago" },
    { id: 2, message: "New Science Fair application", time: "1 hour ago" },
    { id: 3, message: "Feedback form submitted", time: "2 hours ago" }
  ]);

  const handleSignOut = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const stats = [
    { title: "Total Forms", value: "4", icon: FileText },
    { title: "Total Submissions", value: "156", icon: Activity },
    { title: "Active Users", value: "23", icon: Users },
  ];

  return (
    <>
      {/* Overlay */}
      {isOpen && (
        <div 
          className="fixed inset-0 bg-black bg-opacity-50 z-40"
          onClick={onClose}
        />
      )}

      {/* Sidebar */}
      <div className={`fixed right-0 top-0 h-full w-80 bg-white shadow-lg transform transition-transform duration-300 ease-in-out z-50 ${
        isOpen ? 'translate-x-0' : 'translate-x-full'
      }`}>
        {/* Header */}
        <div className="p-4 border-b">
          <div className="flex justify-between items-center">
            <div className="flex items-center space-x-3">
              <div className="w-10 h-10 rounded-full bg-blue-100 flex items-center justify-center">
                <User className="w-5 h-5 text-blue-600" />
              </div>
              <div>
                <h2 className="font-semibold text-gray-800">Admin Panel</h2>
                <p className="text-sm text-gray-500">Form Manager</p>
              </div>
            </div>
            <button onClick={onClose} className="p-2 hover:bg-gray-100 rounded-full">
              <X className="w-5 h-5 text-gray-600" />
            </button>
          </div>
        </div>

        {/* Content */}
        <div className="p-4 space-y-6 overflow-y-auto h-[calc(100%-64px)]">
          {/* Quick Stats */}
          <div className="grid grid-cols-1 gap-4">
            {stats.map((stat, index) => {
              const IconComponent = stat.icon;
              return (
                <div key={index} className="bg-gray-50 p-4 rounded-lg">
                  <div className="flex items-center justify-between">
                    <div>
                      <p className="text-sm text-gray-500">{stat.title}</p>
                      <p className="text-xl font-semibold text-gray-800">{stat.value}</p>
                    </div>
                    <IconComponent className="w-5 h-5 text-blue-600" />
                  </div>
                </div>
              );
            })}
          </div>

          {/* Notifications */}
          <div>
            <button 
              onClick={() => setShowNotifications(!showNotifications)}
              className="w-full flex items-center justify-between p-3 bg-white border rounded-lg hover:bg-gray-50"
            >
              <div className="flex items-center space-x-3">
                <Bell className="w-5 h-5 text-gray-600" />
                <span className="font-medium text-gray-800">Notifications</span>
              </div>
              <span className="bg-blue-100 text-blue-600 px-2 py-1 rounded-full text-xs">
                {notifications.length}
              </span>
            </button>

            {showNotifications && (
              <div className="mt-2 space-y-2">
                {notifications.map(notification => (
                  <div key={notification.id} className="p-3 bg-gray-50 rounded-lg">
                    <p className="text-sm text-gray-800">{notification.message}</p>
                    <span className="text-xs text-gray-500">{notification.time}</span>
                  </div>
                ))}
              </div>
            )}
          </div>

          {/* Quick Actions */}
          <div className="space-y-2">
            <h3 className="font-medium text-gray-800">Quick Actions</h3>
            <button className="w-full flex items-center space-x-3 p-3 bg-gray-50 hover:bg-gray-100 rounded-lg">
              <FileText className="w-5 h-5 text-blue-600" />
              <span className="text-gray-800">Manage Forms</span>
            </button>
            <button className="w-full flex items-center space-x-3 p-3 bg-gray-50 hover:bg-gray-100 rounded-lg">
              <Users className="w-5 h-5 text-blue-600" />
              <span className="text-gray-800">User Access</span>
            </button>
            <button className="w-full flex items-center space-x-3 p-3 bg-gray-50 hover:bg-gray-100 rounded-lg">
              <Settings className="w-5 h-5 text-blue-600" />
              <span className="text-gray-800">Settings</span>
            </button>
          </div>

          {/* Sign Out Button */}
          <div className="pt-4">
            <button 
              onClick={handleSignOut}
              className="w-full flex items-center justify-center space-x-2 bg-red-500 hover:bg-red-600 text-white p-3 rounded-lg transition-colors duration-200"
            >
              <LogOut className="w-4 h-4" />
              <span>Sign Out</span>
            </button>
          </div>
        </div>
      </div>
    </>
  );
};

export default AdminSidebar;
